description:
Rebound (Stormy Daniels, Wicked Pictures / 2013)

Tessa Kendall is a celebrated author/relationship expert, whose life spins out of control when intimate photos of her long-time boyfriend and another woman surface. Devastated, Tessa seeks refuge at her brother's mountain cabin, where she meets and develops feelings for a handsome local named Zach. Still reeling from the betrayal of her last relationship, she leaves Zach and returns home. Only after some time passes (and Tessa pens a best-selling novel - &quot;Rebound&quot;) does Tessa realize her true feelings for Zach and returns to the cabin on the hopes of making things right. Can the damage be undone or in the end was it truly just a REBOUND?

Allie Haze, Kaylani Lei, Lyla Storm, Samantha Ryan

